<script>
import { SignInMixin } from "../../mixin/passport";

export default {
  mixins: [SignInMixin],
  props: ["params"],
  data() {
    return {
      initing: false,
      loaded: false,
      saving: false,
      formStore: {},
      submited: false,
      cfg: {},
      instance: {},
      editable: false,
      finished: false,
      logo: "",
      submitable: true,
      labelPosition: "top",
      labelWith: "110px",
    };
  },
  async created() {
    this.initing = true;

    const success = await this.$store.dispatch("APP_MOCKSIGNIN", { appid: this.params.appid || "" });

    const cfgRet = await this.API.getTreeNode({ code: this.params.code });
    this.cfg = cfgRet.data.data;
    if (this.cfg.pub_config) {
      const pubCfg = JSON.parse(this.cfg.pub_config);

      if (pubCfg.isPublic) {
        this.editable = true;
      }

      if (pubCfg.formLabelPosition) {
        this.labelPosition = pubCfg.formLabelPosition;
      }

      if (pubCfg.formLabelWith) {
        this.labelWith = pubCfg.formLabelWith;
      }

      if (pubCfg.attach) {
        const fileRet = await this.API.file({ data: { ids: pubCfg.attach }, method: "get" });
        if (fileRet.success && fileRet.data.length) {
          this.logo = fileRet.data[0].res_path;
        }
      }

      if (typeof pubCfg.submitable !== "undefined") {
        this.submitable = pubCfg.submitable;
      }

      if (this.params.id) {
        //默认值处理
        if (pubCfg.qrList) {
          const exist = _.find(pubCfg.qrList, { id: this.params.id });
          if (exist) {
            const list = exist.value.split(",");
            list.forEach((i) => {
              const ruleItem = pubCfg.rules[parseInt(i) - 1];
              if (ruleItem) {
                this.instance[ruleItem.id] = ruleItem.val;
              }
            });
          }
        }
      }
    }

    this.initing = false;
  },
  methods: {
    storeReady(store) {
      this.formStore = store;
      this.formStore._forEach((cpnt) => {
        if (typeof this.instance[cpnt.data._fieldValue] !== "undefined") {
          cpnt.data._read = true;
        }
      });
      this.loaded = true;
    },
    async submit() {
      try {
        this.saving = true;
        const formData = await this.$refs.formImage.makeData();
        const ret = await this.API.form({ data: { leaf_id: 1, formData }, method: "put" });
        if (ret.success) {
          this.$message({ type: "success", message: `成功报名` });
          this.saving = false;
          this.submited = true;
        } else {
          this.$message({ type: "warning", message: `报名失败，请稍后再试` });
        }
      } catch (error) {
        this.saving = false;
        return null;
      }
    },
    reload() {
      window.location.reload();
    },
  },
};
</script>
